const DeveloperBenefits = () => {
  const ref = useRef<HTMLDivElement>(null);
  const [expanded, setExpanded] = useState(false);
  const dataForDisplay = expanded
    ? DEVELOPER_BENEFITS
    : DEVELOPER_BENEFITS.slice(0, 16);

  const handleClick = () => {
    setExpanded(!expanded);
    if (expanded) {
      ref.current?.scrollIntoView({ behavior: "smooth" });
    }
  };
  return (
    <>
      <section className='cursor-default'>
        <Container className=' '>
          <p className='section-tagline my-8 text-center' ref={ref}>
            Get hired to one of our teams and you’ll unlock an Unleash+
            membership
          </p>
          <div className='grid grid-cols-2 lg:grid-cols-4 md:gap-6 gap-4 relative '>
            {dataForDisplay.map((benefits: any) => (
              <div
                key={benefits.name}
                className='w-full h-full grid gap-2 text-center md:p-4 p-2  bg-light-gray rounded '
              >
                <div className='w-full flex justify-center fill-current max-h-max'>
                  {benefits.icon}
                </div>
                <h3 className='font-bold'>{benefits.name}</h3>
                <p className='text-gray-400'>{benefits.text}</p>
              </div>
            ))}
            {!expanded && (
              <div
                style={{
                  height: "7em",
                  width: "100%",
                  position: "absolute",
                  bottom: "0px",
                  left: "0px",
                  background:
                    "linear-gradient(rgb(255 255 255 / 0%) 0%, rgb(255 255 255) 100%)",
                  zIndex: 2,
                }}
              ></div>
            )}
          </div>
          <div className='flex justify-center mt-8 '>
            <h3
              className='font-bold text-brand-700 items-center flex cursor-pointer'
              onClick={handleClick}
            >
              {expanded ? (
                <>
                  View less <UpCircleOutlined className='ml-2' />{" "}
                </>
              ) : (
                <>
                  View all <DownCircleOutlined className='ml-2' />{" "}
                </>
              )}
            </h3>
          </div>
        </Container>
      </section>
    </>
  );
};

export default DeveloperBenefits;
